import React from 'react';
import RenderProduct from './renderProduct';

export default function iphone(props){
    const {item} = props;
    const itemProducts = item.filter(value => value.id % 2 === 0)
    return (
        <RenderProduct Products = {itemProducts}/>
    )
}
